package com.ufgov.zc.client.zc.ztb.model;import java.util.Date;public class AsFile {  private String fileId;  private String fullName;  private String suffixName;  private Date fileUploadTime;  private String filePath;  public AsFile() {  }  public AsFile(String fileId, String fullName, String suffixName, String filePath) {    this.fileId = fileId;    this.fullName = fullName;    this.suffixName = suffixName;    this.filePath = filePath;  }  public String getFileId() {    return fileId;  }  public void setFileId(String fileId) {    this.fileId = fileId;  }  public String getFullName() {    return fullName;  }  public void setFullName(String fullName) {    this.fullName = fullName;  }  public String getSuffixName() {    return suffixName;  }  public void setSuffixName(String suffixName) {    this.suffixName = suffixName;  }  public Date getFileUploadTime() {    return fileUploadTime;  }  public void setFileUploadTime(Date fileUploadTime) {    this.fileUploadTime = fileUploadTime;  }  public String getFilePath() {    return filePath;  }  public void setFilePath(String filePath) {    this.filePath = filePath;  }}